import * as React from "react";
import "../css/webbrowser.css";

interface WebBrowserProps {}

const WebBrowser: React.FunctionComponent<WebBrowserProps> = () => {
  function winOpen() {
    let windowFeatures = "popup";
    window.open("", "mozillaWindow", windowFeatures);
  }

  return (
    <div className="webbrowser-container">
      {/* <iframe src="" name="webFrame" width="90%" height="90%" /> */}
      <a
        href="https://www.google.com/"
        onClick={winOpen}
        target="mozillaWindow"
      >
        Open google
      </a>
    </div>
  );
};

export default WebBrowser;
